import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Container, Form, Button, Card } from 'react-bootstrap';

function EmployeeDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [details, setDetails] = useState({
    type: '',
    country: '',
    project: '',
    hourlyRate: '',
    accommodationAddress: '',
    accommodationPrice: ''
  });

  useEffect(() => {
    const fetchDetails = async () => {
      try {
        const response = await axios.get(`http://localhost:5001/api/employees/${id}/details`);
        if (response.data) {
          setDetails(response.data);
        }
      } catch (error) {
        console.error('Error loading employee details:', error);
      }
    };
    fetchDetails();
  }, [id]);

  const handleChange = (e) => {
    setDetails({ ...details, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(`http://localhost:5001/api/employees/${id}/details`, details);
      alert('Detaily uložené.');
      navigate('/employees');
    } catch (error) {
      console.error('Chyba pri ukladaní detailov:', error);
    }
  };

  return (
    <Container className="mt-5">
      <Card className="p-4 shadow-lg">
        <h2 className="text-center mb-4">Firemné údaje</h2>
        <Form onSubmit={handleSubmit}>
          <Form.Group className="mb-3">
            <Form.Label>Typ</Form.Label>
            <Form.Select name="type" value={details.type} onChange={handleChange} required>
              <option value="">-- vyber typ --</option>
              <option value="živnostník">Živnostník</option>
              <option value="zamestnanec">Zamestnanec</option>
            </Form.Select>
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Štát pôsobenia</Form.Label>
            <Form.Control name="country" value={details.country} onChange={handleChange} required />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Projekt</Form.Label>
            <Form.Control name="project" value={details.project} onChange={handleChange} />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Hodinová mzda (€)</Form.Label>
            <Form.Control type="number" name="hourlyRate" value={details.hourlyRate} onChange={handleChange} />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Adresa ubytovania</Form.Label>
            <Form.Control name="accommodationAddress" value={details.accommodationAddress} onChange={handleChange} />
          </Form.Group>

          <Form.Group className="mb-3">
            <Form.Label>Cena ubytovania (€)</Form.Label>
            <Form.Control type="number" name="accommodationPrice" value={details.accommodationPrice} onChange={handleChange} />
          </Form.Group>

          <Button type="submit" variant="success" className="w-100">Uložiť firemné údaje</Button>
        </Form>
      </Card>
    </Container>
  );
}

export default EmployeeDetails;
